description:
This stunning, and one of the kind project has it all----it can be use for your last minute intros. This project comes with stunning transformation text titles, particles, flares, and awesome metal text titles. I have used Optical Flare, plug-in, but you don't have to own it--since I have included 2 projects. A project with plug-ins, and the other without plug-ins. On this one you can insert up to 8 text titles. I have pre-comp most of the layers, so that you can easily add and customize your photos and text titles. To add your text, just click on the folder called Add Your Text Titles Here, and Add Your Photos Here---it's that easy. 1280x720 Only Sounds Effects mix are included

